define('text!daily/create/index.html', ['module'], function(module) { module.exports = "<template>\r\n\t<require from=\"./yesterday\"></require>\r\n\t<require from=\"./today\"></require>\r\n\t<require from=\"./problems\"></require>\r\n\t<require from=\"./metrics\"></require>\r\n\r\n\t<div class=\"sa-layout-dashboard-page_title\">\r\n\t\t<h1 class=\"sa-text --mega --bold\">Ajouter un daily</h1>\r\n\t</div>\r\n\t<div class=\"sa-layout-dashboard-page_content\">\r\n\t\t<div class=\"sa-grid\">\r\n\r\n\t\t\t<div class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t\t<div class=\"sa-panel\">\r\n\t\t\t\t\t<div class=\"sa-category-title\">\r\n\t\t\t\t\t\t<p class=\"sa-text --bold --mega --emphasis-darker\">Sprint Progress</p>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t\t\r\n\t\t\t\t\t<div class=\"sa-form_row\">\r\n\t\t\t\t\t\t<div class=\"sa-grid\">\r\n\t\t\t\t\t\t\t<div class=\"sa-grid_col --half@on-desktop\">\r\n\t\t\t\t\t\t\t\t<fieldset>\r\n\t\t\t\t\t\t\t\t\t<label for=\"current_sprint\" class=\"sa-text --secondary\">Current Sprint</label>\r\n\t\t\t\t\t\t\t\t\t<select value.bind=\"daily.current_sprint\" name=\"current_sprint\" class=\"sa-form_select --full\">\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"75\">Sprint #75</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"76\">Sprint #76</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"77\">Sprint #77</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"78\">Sprint #78</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"79\">Sprint #79</option>\r\n\t\t\t\t\t\t\t\t\t</select>\r\n\t\t\t\t\t\t\t\t</fieldset>\r\n\t\t\t\t\t\t\t</div>\r\n\t\t\t\t\t\t\t<div class=\"sa-grid_col --half@on-desktop\">\r\n\t\t\t\t\t\t\t\t<fieldset>\r\n\t\t\t\t\t\t\t\t\t<label for=\"current_day\" class=\"sa-text --secondary\">Day</label>\r\n\t\t\t\t\t\t\t\t\t<select value.bind=\"daily.date\" name=\"current_sprint\" class=\"sa-form_select --full\">\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"12-03\">Lundi 12</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"13-03\">Mardi 13</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"14-03\">Mercredi 14</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"15-03\">Jeudi 15</option>\r\n\t\t\t\t\t\t\t\t\t\t<option value=\"16-03\">Vendredi 16</option>\r\n\t\t\t\t\t\t\t\t\t</select>\r\n\t\t\t\t\t\t\t\t</fieldset>\r\n\t\t\t\t\t\t\t</div>\r\n\t\t\t\t\t\t</div>\r\n\t\t\t\t\t</div>\r\n\r\n\t\t\t\t\t<div class=\"sa-form_row\">\r\n\t\t\t\t\t\t<hr class=\"sa-line --dashboard\">\r\n\t\t\t\t\t</div>\r\n\r\n\t\t\t\t\t<div class=\"sa-form_row\">\r\n\t\t\t\t\t\t<metrics metrics.bind=\"daily.metrics\"></metrics>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t</div>\r\n\r\n\t\t\t\t<div class=\"sa-form_row\">\r\n\t\t\t\t\t<div class=\"sa-call-to-action --full\" click.delegate=\"saveDaily()\">Enregistrer</div>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\r\n\t\t\t<div class=\"sa-grid_col --two-thirds@on-desktop\">\r\n\t\t\t\t<div class=\"sa-grid\">\r\n\t\t\t\t\t<div class=\"sa-grid_col\">\r\n\t\t\t\t\t\t<yesterday items.bind=\"daily.yesterday\"></yesterday>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t\t<div class=\"sa-grid_col\">\r\n\t\t\t\t\t\t<today items.bind=\"daily.today\"></today>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t\t<div class=\"sa-grid_col\">\r\n\t\t\t\t\t\t<problems items.bind=\"daily.problems\"></problems>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t</div>\r\n</template>"; });
define('text!daily/create/metrics.html', ['module'], function(module) { module.exports = "<template>\r\n\t<div class=\"sa-grid\">\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"done\" class=\"sa-text --secondary\">Done</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.done\" name=\"done\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"doing\" class=\"sa-text --secondary\">Doing</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.doing\" name=\"doing\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"status\" class=\"sa-text --secondary\">Status</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.status\" name=\"status\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"review\" class=\"sa-text --secondary\">Code review</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.review\" name=\"review\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"reviewed\" class=\"sa-text --secondary\">Reviewed</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.reviewed\" name=\"reviewed\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\"></fieldset>\r\n\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"validation\" class=\"sa-text --secondary\">Validation</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.validation\" name=\"validation\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\">\r\n\t\t\t<label for=\"blocked\" class=\"sa-text --secondary\">Bloqué</label>\r\n\t\t\t<input type=\"number\" value.bind=\"metrics.blocked\" name=\"blocked\" class=\"sa-form_text\">\r\n\t\t</fieldset>\r\n\t\t<fieldset class=\"sa-grid_col --one-third@on-desktop\"></fieldset>\r\n\t</div>\r\n</template>"; });
define('text!daily/create/problems.html', ['module'], function(module) { module.exports = "<template>\r\n\t<div class=\"sa-panel\">\r\n\t\t<div class=\"sa-category-title\">\r\n\t\t\t<p class=\"sa-text --bold --mega --emphasis-darker\">Problèmes rencontrés</p>\r\n\t\t</div>\r\n\t\t<div class=\"sa-form_row\">\r\n\t\t\t\r\n\t\t\t<p class=\"sa-text\" show.bind=\"items.length == 0\">Il n'y a rien ici !</p>\r\n\r\n\t\t\t<div class=\"sa-spaced-between\" repeat.for=\"item of items\">\r\n\t\t\t\t<div class=\"sa-spaced-between_item\">\r\n\t\t\t\t\t<p class=\"sa-text\">${item.what}</p>\r\n\t\t\t\t\t<p class=\"sa-text --inline\"><span class=\"sa-text --bold --inline\">Solution : </span>${item.correction}</p>\r\n\t\t\t\t</div>\r\n\t\t\t\t<div class=\"sa-spaced-between_item\">\r\n\t\t\t\t\t<button click.delegate=\"deleteItem(item)\" class=\"sa-call-to-action --pill\">\r\n\t\t\t\t\t\t<i class=\"material-icons sa-icon --material\">delete</i>\r\n\t\t\t\t\t</button>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\r\n\t\t</div>\r\n\r\n\t\t<div class=\"sa-form_row\">\r\n\t\t\t<form submit.delegate=\"addItem()\">\r\n\t\t\t\t<div class=\"sa-form_input-group --call-to-action-input\">\r\n\t\t\t\t\t<div style=\"flex-grow: 1\">\r\n\t\t\t\t\t\t<input type=\"text\" name=\"problem\" value.bind=\"problem.what\" placeholder=\"What was the problem ?\" class=\"sa-form_text\">\r\n\t\t\t\t\t\t<input type=\"text\" name=\"correction\" value.bind=\"problem.correction\" placeholder=\"How do we solve it\" class=\"sa-form_text\">\r\n\t\t\t\t\t</div>\r\n\t\t\t\t\t<button type=\"submit\" class=\"sa-call-to-action --secondary --call-to-action-input\" disabled.bind=\"!(problem.what && problem.correction)\">\r\n\t\t\t\t\t\t<i class=\"material-icons sa-icon --material --mega\">add</i>\r\n\t\t\t\t\t</button>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t</div>\r\n</template>"; });
